import React from "react";

import "./footer.styles.css";

const Footer = () => {
  return (
    <div className="footer__container">
      <div className="footer__subcontainer">
        <div><ul>
        <li>Careers</li>  
        <li>Blog</li>  
        <li>About Amazon</li>  
        <li>Careers</li>  
        <li>Careers</li>  
          </ul></div>
        <div>Columna 2</div>
        <div>Columna 3</div>
        <div>Columna 4</div>
      </div>
    </div>
  );
};

export default Footer;
